import React, { useEffect, useState } from 'react';
import axios from 'axios';

function TransactionHistory() {
  const [purchases, setPurchases] = useState([]);
  const [transfers, setTransfers] = useState([]);
  const [assignments, setAssignments] = useState([]);
  const [expenditures, setExpenditures] = useState([]);

  useEffect(() => {
    fetchTransactions();
  }, []);

  const fetchTransactions = async () => {
    try {
      const [pRes, tRes, aRes, eRes] = await Promise.all([
        axios.get('http://localhost:5000/api/assets/purchases'),
        axios.get('http://localhost:5000/api/assets/transfers'),
        axios.get('http://localhost:5000/api/assets/assignments'),
        axios.get('http://localhost:5000/api/assets/expenditures'),
      ]);

      setPurchases(pRes.data);
      setTransfers(tRes.data);
      setAssignments(aRes.data);
      setExpenditures(eRes.data);
    } catch (error) {
      console.error('Error fetching transaction data:', error);
    }
  };

  return (
    <div>
      <h2>Transaction History</h2>

      <h3>Purchases</h3>
      <table border="1">
        <thead>
          <tr>
            <th>Purchase ID</th>
            <th>Asset ID</th>
            <th>Quantity</th>
            <th>Purchased On</th>
          </tr>
        </thead>
        <tbody>
          {purchases.map((p) => (
            <tr key={p.purchase_id}>
              <td>{p.purchase_id}</td>
              <td>{p.asset_id}</td>
              <td>{p.quantity}</td>
              <td>{p.purchased_on}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h3>Transfers</h3>
      <table border="1">
        <thead>
          <tr>
            <th>Transfer ID</th>
            <th>Asset ID</th>
            <th>From Base</th>
            <th>To Base</th>
            <th>Quantity</th>
            <th>Transfer Date</th>
          </tr>
        </thead>
        <tbody>
          {transfers.map((t) => (
            <tr key={t.transfer_id}>
              <td>{t.transfer_id}</td>
              <td>{t.asset_id}</td>
              <td>{t.from_base_id}</td>
              <td>{t.to_base_id}</td>
              <td>{t.quantity}</td>
              <td>{t.transfer_date}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h3>Assignments</h3>
      <table border="1">
        <thead>
          <tr>
            <th>Assignment ID</th>
            <th>Asset ID</th>
            <th>Personnel ID</th>
            <th>Quantity</th>
            <th>Assigned On</th>
          </tr>
        </thead>
        <tbody>
          {assignments.map((a) => (
            <tr key={a.assignment_id}>
              <td>{a.assignment_id}</td>
              <td>{a.asset_id}</td>
              <td>{a.personnel_id}</td>
              <td>{a.quantity}</td>
              <td>{a.assigned_on}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h3>Expenditures</h3>
      <table border="1">
        <thead>
          <tr>
            <th>Expenditure ID</th>
            <th>Asset ID</th>
            <th>Quantity</th>
            <th>Expended On</th>
          </tr>
        </thead>
        <tbody>
          {expenditures.map((e) => (
            <tr key={e.expenditure_id}>
              <td>{e.expenditure_id}</td>
              <td>{e.asset_id}</td>
              <td>{e.quantity}</td>
              <td>{e.expended_date}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default TransactionHistory;
